import React, {useState}  from 'react'


export default function TodoList() {
  return (
    <div className='todoListMain'>
      <div className='header'>
        <form>
          <input placeholder='Enter new task'></input>
          <button type='submit'>Add</button>
        </form>
      </div>
    </div>
  )
}
